import React from 'react';
import '../../../App.js';
let image = require("public/images/skeleton.jpeg");

function Gallery_Skeleton() {
    return (
        <>
        <h1> Skeleton Artwork </h1>
        <img src={image.default} alt="image not found" />
        <p> This art work is about blah blah </p>
        </>
    )

}

export default Gallery_Skeleton
